	module.exports = {"data":[{"additionalPlain":"About the Team\n\nIf you are passionate about conceptualising, planning, and building things at scale - we would love to talk to you. As part of the consumer platform group, you will partner with a team of enormously talented engineers, designers and UX researchers to enable solutions for users on the GoJek app, powered by fully reliable infrastructure & tooling. \nBeing part of the communication stream you will play a pivotal role in enabling use cases on the Gojek platform while ensuring delightful, non intrusive communication channels for various Gojek user types (consumers, drivers, merchants etc).\n\n\n\nGojek is an equal opportunity workplace that is committed to diversity and inclusion. At Gojek we celebrate our differences, because we believe that diversity not only creates a healthier work environment for our employees, but also helps our business thrive. \n\n\n\nAbout us\n\nGojek is a technology startup based in Jakarta, Indonesia. Specialising in ride-hailing and logistics, we are also the only company in Southeast Asia to be part of Fortune's 50 Companies That Changed the World (2017).\n\nGojek is a Super App: one app with over 20 services including food delivery, commuting, digital payments, shopping, hyper-local delivery, massages, and many more.\n\nGojek is Indonesia’s first and fastest growing unicorn building an on-demand empire. Our total of 2,000,000 driver-partners collectively travel 16.5 million KM daily – making us Indonesia’s de-facto transportation choice.\n\nGojek is a verb! Gojek is a way of life!","additional":"<div><b>About the Team</b></div><div><br></div><div><span style=\"font-size: 10.5pt\">If you are passionate about </span>conceptualising<span style=\"font-size: 10.5pt\">, planning, and building things at scale - we would love to talk to you. As part of the consumer platform group, you will partner with a team of enormously talented engineers, designers and UX researchers to enable solutions for users on the GoJek app, powered by fully reliable infrastructure &amp; tooling.&nbsp;</span></div><div><span style=\"font-size: 10.5pt\">Being part of the communication stream you will play a pivotal role in enabling use cases on the Gojek platform while ensuring delightful, non intrusive communication channels for various Gojek user types (consumers, drivers, merchants etc).</span></div><div><br></div><div><br></div><div>Gojek is an equal opportunity workplace that is committed to diversity and inclusion. At Gojek we celebrate our differences, because we believe that diversity not only creates a healthier work environment for our employees, but also helps our business thrive.&nbsp;</div><div><br></div><div><br></div><div><br></div><div><b><i>About us</i></b></div><div><br></div><div>Gojek is a technology startup based in Jakarta, Indonesia. Specialising in ride-hailing and logistics, we are also the only company in Southeast Asia to be part of Fortune's 50 Companies That Changed the World (2017).</div><div><br></div><div>Gojek is a <b>Super App</b>: one app with over 20 services including food delivery, commuting, digital payments, shopping, hyper-local delivery, massages, and many more.</div><div><br></div><div>Gojek is Indonesia’s <b>first and fastest </b>growing unicorn building an on-demand empire. Our total of 2,000,000 driver-partners collectively travel 16.5 million KM daily – making us Indonesia’s de-facto transportation choice.</div><div><br></div><div>Gojek is a verb! Gojek is a way of life!</div>","categories":{"commitment":"Permanent","department":"Engineering","location":"Bengaluru","team":"Product Engineering"},"createdAt":1553838574670,"descriptionPlain":"About the Role\n\nPassionate, entrepreneurial developers with a drive for developing and deploying applications at scale, to join our Chat Team in Bangalore. In this role you will be responsible to design, develop and deploy Android applications aimed at improving customer experience on Chat. You will also be responsible for the overall UX and high reliability of Android application. \n","description":"<div><b>About the Role</b></div><div><br></div><div>Passionate, entrepreneurial developers with a drive for developing and deploying applications at scale, to join our Chat Team in Bangalore. In this role you will be responsible to design, develop and deploy Android applications aimed at improving customer experience on Chat. You will also be responsible for the overall UX and high reliability of Android application.&nbsp;</div>","id":"6baeffbd-5a29-4092-9c1f-0e3c1fe5b84f","lists":[{"text":"What you'll do","content":"<li>Design and develop highly scalable, highly available, reliable, secure and fault tolerant systems with minimal guidance for one of the world's fastest growing company in travel</li><li>Translate business requirements into scalable and extensible design</li><li>Pair with team members on functional and nonfunctional requirements and spread</li><li>Design philosophy, goals and improve the code quality across the team</li><li>Coordinate with cross functional teams (Mobile, DevOps, UX, QA etc.) on planning and execution</li><li>Communicate, collaborate and work effectively across cross functional teams in a global environment</li><li>Building and managing automated build/test/deployment environments</li><li>Research new technologies and tools that enable building the next generation of GO-JEK services</li>"},{"text":"What you'll need","content":"<li>2 - 5 years of relevant software development experience</li><li>2 - 5 years of hands on experience in designing, developing, testing and deploying</li><li>applications on Java, Go-Lang and Ruby large-scale applications</li><li>Proficient in OOP, SQL, Design Patterns</li><li>Prior experience with distributed systems and messaging is a must </li><li>Data modelling experience in Relational databases</li><li>Well versed with Agile methodologies, TDD and Test Engineering and Automation</li><li>Experience troubleshooting server performance - memory issues, GC tuning, resource leaks etc.</li><li>Excellent understanding of interactive application development paradigm, memory</li><li>management, performance/resource optimizations, database interactions, network programming, concurrency and multithreading, fault tolerance, monitoring, security and operability of systems</li><li>Continuously refactor applications to ensure high quality design</li><li>Ability to plan, prfioritize, estimate and execute releases with good degree of predictability</li><li>Ability to scope, review and refine user stories for technical completeness and to</li><li>Alleviate dependency risks</li>"}],"text":"Backend Engineer - Identity and Communications Platform","hostedUrl":"https://jobs.lever.co/gojek/6baeffbd-5a29-4092-9c1f-0e3c1fe5b84f","applyUrl":"https://jobs.lever.co/gojek/6baeffbd-5a29-4092-9c1f-0e3c1fe5b84f/apply"},{"additionalPlain":"About the Team\n\nIf you are passionate about conceptualising, planning, and building things at scale - we would love to talk to you. As part of the cor platform group, you will partner with a team of enormously talented engineers, designers and UX researchers to enable solutions for users on the GoJek app, powered by fully reliable infrastructure & tooling.\nChat platform team provides the communication tool for easier coordination around transactions on the Gojek platform. It is the best and preferred mode of communication for a seamless booking experience.\n\n\n\nGojek is an equal opportunity workplace that is committed to diversity and inclusion. At Gojek we celebrate our differences, because we believe that diversity not only creates a healthier work environment for our employees, but also helps our business thrive. \n\n\n\nAbout us\n\nGojek is a technology startup based in Jakarta, Indonesia. Specialising in ride-hailing and logistics, we are also the only company in Southeast Asia to be part of Fortune's 50 Companies That Changed the World (2017).\n\nGojek is a Super App: one app with over 20 services including food delivery, commuting, digital payments, shopping, hyper-local delivery, massages, and many more.\n\nGojek is Indonesia’s first and fastest growing unicorn building an on-demand empire. Our total of 2,000,000 driver-partners collectively travel 16.5 million KM daily – making us Indonesia’s de-facto transportation choice.\n\nGojek is a verb! Gojek is a way of life!","additional":"<div><b>About the Team</b></div><div><br></div><div><span style=\"font-size: 10.5pt\">If you are passionate about </span>conceptualising<span style=\"font-size: 10.5pt\">, planning, and building things at scale - we would love to talk to you. As part of the cor platform group, you will partner with a team of enormously talented engineers, designers and UX researchers to enable solutions for users on the GoJek app, powered by fully reliable infrastructure &amp; tooling.</span></div><div>Chat platform team provides the communication tool for easier coordination around transactions on the Gojek platform. It is the best and preferred mode of communication for a seamless booking experience.</div><div><br></div><div><br></div><div>Gojek is an equal opportunity workplace that is committed to diversity and inclusion. At Gojek we celebrate our differences, because we believe that diversity not only creates a healthier work environment for our employees, but also helps our business thrive.&nbsp;</div><div><br></div><div><br></div><div><br></div><div><b><i>About us</i></b></div><div><br></div><div>Gojek is a technology startup based in Jakarta, Indonesia. Specialising in ride-hailing and logistics, we are also the only company in Southeast Asia to be part of Fortune's 50 Companies That Changed the World (2017).</div><div><br></div><div>Gojek is a <b>Super App</b>: one app with over 20 services including food delivery, commuting, digital payments, shopping, hyper-local delivery, massages, and many more.</div><div><br></div><div>Gojek is Indonesia’s <b>first and fastest </b>growing unicorn building an on-demand empire. Our total of 2,000,000 driver-partners collectively travel 16.5 million KM daily – making us Indonesia’s de-facto transportation choice.</div><div><br></div><div>Gojek is a verb! Gojek is a way of life!</div>","categories":{"commitment":"Permanent","department":"Engineering","location":"Bengaluru","team":"Mobile Engineering"},"createdAt":1552904852004,"descriptionPlain":"About the Role\n\nWe are looking for passionate, entrepreneurial developers with a drive for developing and deploying applications at scale, to join our caht platform Team in Bangalore. In this role you will be responsible to design, develop and deploy iOS applications aimed at improving customer experience on GoFood. You will also be responsible for the overall UX and high reliability of the iOS application \n","description":"<div><b>About the Role</b></div><div><br></div><div>We are looking for passionate, entrepreneurial developers with a drive for developing and deploying applications at scale, to join our caht platform Team in Bangalore. In this role you will be responsible to design, develop and deploy iOS applications aimed at improving customer experience on GoFood. You will also be responsible for the overall UX and high reliability of the iOS application&nbsp;</div>","id":"eee13b8f-c1bb-4b86-bcd8-59059325d5e4","lists":[{"text":"What you'll do","content":"<li>Design, build and improve the mobile experiences for one of the world's fastest growing mobile app in ride- hailing, payments and logistics</li><li>Partner with the product management team and other cross-functional teams to define and execute the feature roadmap and backend engineering teams to build robust, well-designed API contracts</li><li>Proactively manage stakeholders communication related to deliverables, risks, changes, and dependencies.</li><li>Provide technical leadership to the team and foster engineering excellence</li>"},{"text":"What you'll need","content":"<li>Working knowledge of the general mobile landscape, architectures, trends, and emerging &nbsp;&nbsp;technologies</li><li>&nbsp; At least 4-5 years of experience in iOS development</li><li>&nbsp; Strong understanding of iOS Apps architecture and implementation (MVC, VIPER, MVVM)</li><li>&nbsp; Prior experience in building Frameworks and SDKs</li><li>&nbsp; Proficiency in Swift 4+, Xcode 10+</li><li>&nbsp; Ability to write product specifications and actively participate in the planning phase</li><li>&nbsp; Ability to write model code for functional and nonfunctional requirements and help improve the code quality standard across the team</li><li>&nbsp; Working experience with popular third-party libraries for networking, async, image loading etc</li><li>&nbsp; Ability to create extendable and reusable eco systems &amp; platforms and mobile</li><li>&nbsp; Solid understanding of implementing continuous Integration and Continuous Delivery principles</li><li>&nbsp; Familiarity with Instruments, LLDB, and other debugging tools</li><li>&nbsp; Prior experience in building a Chat ecosystem</li><li>&nbsp; Prior knowledge of OSI session, network and transport layer technologies like web sockets, gRPC etc.</li><li>&nbsp; Ability to troubleshoot fuzzy problems across systems and subsystems effectively</li><li>&nbsp; Ability to design systems/subsystems, API contracts and enable platformization independently</li><li>&nbsp; Basic knowledge of Android code structure to understand requirements of a mobile platform holistically, and proven capability to design features that span across mobile platforms (Android + iOS)</li><li>&nbsp; Familiarity with Agile methodologies, TDD and Test Engineering and Automation</li>"}],"text":"iOS Engineer - Identity & Communication Platform","hostedUrl":"https://jobs.lever.co/gojek/eee13b8f-c1bb-4b86-bcd8-59059325d5e4","applyUrl":"https://jobs.lever.co/gojek/eee13b8f-c1bb-4b86-bcd8-59059325d5e4/apply"},{"additionalPlain":"The ICP  team is responsible for making sure that our millions of customers can securely log in to our applications anywhere in the world, and also helping all our products communicate securely and with confidence with our users. At its core, this is a unique team that interfaces directly with end-user and at the same time serves other product teams, thus providing opportunity to do both iterative product building with end-users as well as well documented API first products.You’ll learn to understand how engineering, fraud and security teams, among others, work together to solve issues. Since most of your API customers would be in-house, this position also provides an opportunity to influence our product groups on new technologies and practices you believe in.\n\n\nGojek is an equal opportunity workplace that is committed to diversity and inclusion. At Gojek we celebrate our differences, because we believe that diversity not only creates a healthier work environment for our employees, but also helps our business thrive. \n\n\n\nAbout us\n\nGojek is a technology startup based in Jakarta, Indonesia. Specialising in ride-hailing and logistics, we are also the only company in Southeast Asia to be part of Fortune's 50 Companies That Changed the World (2017).\n\nGojek is a Super App: one app with over 20 services including food delivery, commuting, digital payments, shopping, hyper-local delivery, massages, and many more.\n\nGojek is Indonesia’s first and fastest growing unicorn building an on-demand empire. Our total of 2,000,000 driver-partners collectively travel 16.5 million KM daily – making us Indonesia’s de-facto transportation choice.\n\nGojek is a verb! Gojek is a way of life!","additional":"<div>The ICP&nbsp; team is responsible for making sure that our millions of customers can securely log in to our applications anywhere in the world, and also helping all our products communicate securely and with confidence with our users. At its core, this is a unique team that interfaces directly with end-user and at the same time serves other product teams, thus providing opportunity to do both iterative product building with end-users as well as well documented API first <a href=\"http://products.You\">products.You</a>’ll learn to understand how engineering, fraud and security teams, among others, work together to solve issues. Since most of your API customers would be in-house, this position also provides an opportunity to influence our product groups on new technologies and practices you believe in.</div><div><br></div><div>Gojek is an equal opportunity workplace that is committed to diversity and inclusion. At Gojek we celebrate our differences, because we believe that diversity not only creates a healthier work environment for our employees, but also helps our business thrive.&nbsp;</div><div><br></div><div><br></div><div><br></div><div><b><i>About us</i></b></div><div><br></div><div>Gojek is a technology startup based in Jakarta, Indonesia. Specialising in ride-hailing and logistics, we are also the only company in Southeast Asia to be part of Fortune's 50 Companies That Changed the World (2017).</div><div><br></div><div>Gojek is a <b>Super App</b>: one app with over 20 services including food delivery, commuting, digital payments, shopping, hyper-local delivery, massages, and many more.</div><div><br></div><div>Gojek is Indonesia’s <b>first and fastest </b>growing unicorn building an on-demand empire. Our total of 2,000,000 driver-partners collectively travel 16.5 million KM daily – making us Indonesia’s de-facto transportation choice.</div><div><br></div><div>Gojek is a verb! Gojek is a way of life!</div>","categories":{"commitment":"Permanent","department":"Science","location":"Bengaluru","team":"Business Intelligence"},"createdAt":1581672474038,"descriptionPlain":"As a Product Analyst, you will be based in Bangalore supporting the Identity & Communication Platform team. You will work as a partner with product managers helping them set the right metrics to be measured for a particular product. You will be expected to be able to provide insights about the adoption and effectiveness of particular newly launched features, as well as designing A/B tests and experimentation for product features, analyze how the key metrics respond and come up with a conclusion.\n\nAs a Product Analyst in Bangalore, you will be an extension to the Gojek Business Intelligence (BI) team.\n","description":"<div>As a Product Analyst, you will be based in Bangalore supporting the Identity &amp; Communication Platform team. You will work as a partner with product managers helping them set the right metrics to be measured for a particular product. You will be expected to be able to provide insights about the adoption and effectiveness of particular newly launched features, as well as designing A/B tests and experimentation for product features, analyze how the key metrics respond and come up with a conclusion.</div><div><br></div><div>As a Product Analyst in Bangalore, you will be an extension to the Gojek Business Intelligence (BI) team.</div>","id":"9ac76785-a87b-45f1-840e-2eb48b06f1dd","lists":[{"text":"Responsibilities","content":"<li>Leverage business analysis and statistical method to analyze and derive insight from various in-app and transactional data points</li><li>Communicate insight using data visualization tool</li><li>Design and develop regular reports and actionable dashboards to gather insight and track business/product performance</li><li>Collaborate with cross-functional teams of product managers, data engineers, data scientists, and research team on product experiments, campaigns, identifying business/product opportunities</li>"},{"text":"Requirements","content":"<li>Bachelor degree in statistics, computer science, data science, business analytics, mathematics, or similar quantitative disciplines</li><li>Fluent in English both written and verbal</li><li>Familiarity with SQL, Statistical Method ,and Modeling</li><li>Exhibit adequate problem solving, critical thinking, business judgment, and analytical skills</li><li>Able to collaborate effectively in a team, while managing him/herself independently as needed</li>"}],"text":"Product Analyst - Identity & Communication Platform","hostedUrl":"https://jobs.lever.co/gojek/9ac76785-a87b-45f1-840e-2eb48b06f1dd","applyUrl":"https://jobs.lever.co/gojek/9ac76785-a87b-45f1-840e-2eb48b06f1dd/apply"}]}

